const intialState = [
  { id: 0, name: "Acha", number: 98523434 },
  { id: 1, name: "Rha'ah", number: 809234854 },
];

const contactReducer = (state = intialState, action) => {
    switch (action.type) {
        default: return state
    }
}
export default contactReducer;
